import { Component, ViewEncapsulation, ViewChild } from '@angular/core';
import { DocumentEditorComponent, ViewChangeEventArgs, PrintService } from '@syncfusion/ej2-angular-documenteditor';
import { DocumentLoader } from './../../../../src/app/document-editor/document-loader';
import { TitleBar } from './../../../../src/app/document-editor/title-bar';
import { StatusBar } from './../../../../src/app/document-editor/status-bar';
/**
 * Print Component
 */
@Component({
    selector: 'app-root',
    templateUrl: 'app.component.html',
    encapsulation: ViewEncapsulation.None,
    providers: [PrintService]
})
export class AppComponent {
    @ViewChild("documenteditor_print")
