    public documentChange = (): void => {
        if (!this.isComponentCreated) {
            this.isComponentCreated = true;
            setTimeout(() => {
                this.initHelperModules();
            });
        }
        this.applyPageCountAndDocumentTitle();
    };
    public zoomFactorChange = (): void => {
        this.statusBar.updateZoomContent();
    };

    public viewChange = (e: ViewChangeEventArgs) => {
        this.onViewChange(e);
    };
    private updateContainerSize(): void {
        let titleBarDiv: HTMLElement = document.getElementById('documenteditor_titlebar');
        let statusBarDiv: HTMLElement = document.getElementById('documenteditor_statusbar');
        if (this.containerPanel && titleBarDiv && statusBarDiv) {
            this.containerPanel.style.height = window.innerHeight - (titleBarDiv.offsetHeight
                + statusBarDiv.offsetHeight) + 'px';
        }
    }
    private applyPageCountAndDocumentTitle(): void {
        if (this.titleBar && this.statusBar) {
            //Sets Document name.
            this.titleBar.updateDocumentTitle();
            this.statusBar.updatePageCount();
        }
    }
    private onViewChange(args: ViewChangeEventArgs): void {
        this.statusBar.updatePageNumberOnViewChange(args);
    }
